import React from 'react';
import {BrowserRouter,Redirect,Switch,Route} from 'react-router-dom'

function App() {
  return (
    <React.Fragment>
      <BrowserRouter>
        <Switch>
          <Route path='/login' exact>
            <Login/>
          </Route>
          <Route path='signup' exact>
            <Signup/>
          </Route>
          <Route path='/' >
            <Home/>
          </Route>
        </Switch>
      </BrowserRouter>
    </React.Fragment>
  );
}

export default App;
